import { createMuiTheme, ThemeProvider } from "@material-ui/core";
import CssBaseLine from "@material-ui/core/CssBaseline";

const theme = createMuiTheme({
  overrides: {
    MuiCssBaseline: {
      "@global": {
        palette: {
          primary: {
            main: "#607d8b",
          },
          primary2Color: "#263238",
          accent1Color: "#f44336",
          textColor: "rgba(0, 0, 0, 0.87)",
          secondaryTextColor: "#b0bec5",
          primary3Color: "rgba(117, 117, 117, 0.91)",
          accent2Color: "#f50057",
          accent3Color: "#ff80ab",
          alternateTextColor: "#ff5722",
          canvasColor: "#90a4ae",
          borderColor: "rgba(255, 255, 255, 0.87)",
          disabledColor: "rgba(255, 255, 255, 0.47)",
          pickerHeaderColor: "rgba(255, 255, 255, 0.18)",
          clockCircleColor: "rgba(255, 255, 255, 0.24)",
          shadowColor: "rgba(0, 0, 0, 0.75)",
        },
        appBar: {
          color: "#607d8b",
          textColor: "rgba(255, 255, 255, 0.87)",
          height: 67,
          titleFontWeight: 400,
          padding: 24,
        },
        badge: {
          color: "#00acc1",
          fontWeight: 500,
          textColor: "rgba(0, 0, 0, 0.85)",
          primaryColor: "rgba(96, 125, 139, 0.98)",
          primaryTextColor: "rgba(255, 255, 255, 0.54)",
        },
        button: {
          height: 36,
          minWidth: 88,
          iconButtonSize: 48,
        },
        card: {
          titleColor: "#263238",
          subtitleColor: "rgba(0, 0, 0, 0.58)",
          fontWeight: 500,
        },
        spacing: {
          iconSize: 24,
          desktopGutter: 24,
          desktopGutterMore: 32,
          desktopGutterLess: 16,
          desktopGutterMini: 8,
          desktopKeylineIncrement: 64,
          desktopDropDownMenuItemHeight: 32,
          desktopDropDownMenuFontSize: 16,
          desktopDrawerMenuItemHeight: 48,
          desktopSubheaderHeight: 48,
          desktopToolbarHeight: 56,
        },
        borderRadius: 4,
      },
    },
  },
});

const Theme = ({ children }) => {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseLine />
      {children}
    </ThemeProvider>
  );
};
export default Theme;
